import request from '@/utils/request';
export default {
  getList: function getList(params) {
    return request({
      url: '/sys/express/list',
      method: 'get',
      params: params
    });
  },
  queryAll: function queryAll() {
    return request({
      url: '/sys/express/queryAll',
      method: 'get'
    });
  },
  save: function save(params) {
    return request({
      url: '/sys/express',
      method: 'post',
      params: params
    });
  },
  remove: function remove(id) {
    return request({
      url: '/sys/express',
      method: 'delete',
      params: {
        id: id
      }
    });
  },
  changeDisabled: function changeDisabled(id, disabled) {
    return request({
      url: '/sys/express/changeDisabled',
      method: 'post',
      params: {
        id: id,
        disabled: disabled
      }
    });
  }
};
